redConnection: any; // Change this type to whatever is appropriate\n    isAdmin: boolean;\n  };\n}\n\n@Component({\n  selector: 'app-connection',\n  templateUrl: './connection.component.html',\n  styleUrls: ['./connection.component.css'],\n})\nexport class ConnectionComponent {\n  email!: string;\n  password!: string;\n\n  constructor(\n    private apollo: Apollo,\n    private router: Router\n  ) {}\n\n  async connect() {\n    try {\n      const result = await firstValueFrom(\n        this.apollo\n          .mutate({\n            mutation: AUTHENTICATE,\n            variables: {\n              email: this.email,\n              password: this.password,\n            },\n          })\n          .pipe(\n            tap(({ data }) => {\n              console.log('got data ', data);\n              if (data && data.authenticate && data.authenticate.accessToken) {\n                // Store the token in local storage\n                localStorage.setItem(\n                  'access-token',\n                  data.authenticate.accessToken\n                );\n                // Navigate to /dashboard if login is successful\n                this.router.navigate(['/admin']);\n                document.body.classList.add('logged-in');\n              }\n            }),\n            catchError((error) => {\n              console.log('there was an error sending the query', error);\n              return of(error); // return a new Observable\n            })\n          )\n      );\n      console.log(result);\n    } catch (error) {\n      console.error(error);\n    }\n  }\n}\n\n    \n\n    \n        \n\n\n  \n    \n    Admin Center\n    \n      \n        \n          Email\n          \n        \n        \n          Password\n          \n        \n        Submit\n      \n    \n  \n\n\n    \n\n    \n                \n                    ./connection.component.css\n                \n                body {\n  font-family: 'Arial', sans-serif;\n  display: flex;\n  justify-content: center;\n  